import React from "react";
import "./Trash.css";
import Profile from "./Profile";
import Header from "../Workplace/Header";
import trash from "../assets/trash.svg";

function Profile_trash() {
    return (
        <div>
            <Header />
            <Profile />
            <div className="trash">
                <h2>Recently Deleted</h2>
                <p className="trash_p">
                    Workspace or space will automatically deleted from your Trash folder after 30 days.
                </p>
                <h2>My First Workspace</h2>
                <Popover
                    minWidth={120}
                    content={
                        <Menu>
                            <Menu.Group>
                                <Menu.Item style={menu} icon={<Avatar src={settings} shape="square" size={10} />}>
                                    <p className="menucontent">Workspace settings</p>
                                </Menu.Item>
                                <Menu.Item style={menu} icon={<img src={trash} alt="" height="10" width="10" />}>
                                    <p className="menucontent">Share workspace</p>
                                </Menu.Item>
                            </Menu.Group>
                        </Menu>
                    }
                >
                    <img src={arrow} alt="" className="arrow" />
                </Popover>
            </div>
        </div>
    );
}

export default Profile_trash;
